import logo from '../../img/logo-187x66.png';
import classes from './Navigation.module.css'
import ListDropdown from "./ListDropdown";
import {NavLink} from "react-router-dom";
import React from "react";
import crossIcon from '../../img/icon/crossIcon.png';
import butgerIcon from '../../img/icon/burgerIcon.png';




class Navigation extends React.Component {
    constructor(props) {
        super(props);
        this.state = {menuDisplay: false};
        let  DropdownLi = this.props.menuData.map(e=>
            <li key={e.id} className={classes.li_dropdoun}>
                <a href={e.url}>{e.label}</a>
            </li>
        );

        this.handleClick = this.handleClick.bind(this);

    }




    handleClick () {
        this.state.menuDisplay ? this.setState(state =>({menuDisplay: false})) : this.setState(state =>({menuDisplay: true }));


    };

    render(){
        return (
            <div  className={classes.block}>
                <div className={classes.item_img}>
                    <a href="/about"><img src={logo} alt="logotype"/></a>
                </div>
                <div   className={classes.burger} onClick={(e) => this.handleClick(e)}    style={this.state.menuDisplay ?{ backgroundImage:`url(${crossIcon})` }:{ backgroundImage:`url(${butgerIcon})` }} > </div>
                
                <ListDropdown menuSidebar ={this.props.menuSidebar} menuData={this.props.menuData} menuDisplay={this.state.menuDisplay}/>

                <div  className={classes.item_menu}>

                    <ul className={classes.ul_menu}>
                        <li key='id' className={classes.li_menu}><NavLink to="/#" activeClassName={classes.active}>Home</NavLink></li>
                        <li key='id1' className={classes.li_menu}><NavLink to="/about" activeClassName={classes.active}>About</NavLink></li>
                        <li key='id2' className={classes.li_menu}><a href="/#"> Service&#8195;&#709;</a>
                            <ul className={classes.ul_dropdoun}>
                                {this.props.DropdownLi}
                            </ul>
                        </li>
                        <li key='id3' className={classes.li_menu}><NavLink to="/portfolio" activeClassName={classes.active}>Portfolio</NavLink></li>
                        <li key='id4' className={classes.li_menu}><NavLink to="/blog" activeClassName={classes.active}>Blog</NavLink></li>
                        <li key='id5' className={classes.li_menu}><NavLink to ="/contact" activeClassName={classes.active}>Contact</NavLink></li>
                    </ul>
                    <div  className={classes.btn}>
                        <a href="/contact"> <button className={classes.btn1}>get a free quote</button></a>
                        <a href="tel:+917737791591"> <button className={classes.btn2}>call <big>&#128381;</big></button></a>
                    </div>

                </div>


            </div>
        );


    }


};
export default Navigation;





